import ListGroup from 'react-bootstrap/ListGroup';
import Card from 'react-bootstrap/Card';

const ShuffleTimeCards = (props) => {


    const { tableName, foreignerArray, japaneseArray } = props;

    function loadTableList() {
        return japaneseArray.map((attendee) => {
            return (
                <ListGroup.Item> {attendee} Japanese </ListGroup.Item>
            )
        })
    }

    return (
        <Card style={{ width: '18rem' }}>
        <Card.Body>
            <Card.Title>{ tableName }</Card.Title>
        </Card.Body>
        <ListGroup className="list-group-flush">
            {loadTableList()}
        </ListGroup>
        </Card>
    )
};

export default ShuffleTimeCards;
